const compile = require("@blisp/compiler/compile")
const { assignmentExpression } = require("@babel/types")
//(#%= foo bar)
function AssignmentOperator(form) {
  return assignmentExpression(
    "=",
    compile.call(this, form[1]),
    compile.call(this, form[2])
  )
}

module.exports = { [Symbol.for("#%=")]: AssignmentOperator }
